import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import { getPost } from "../services/posts";

const Post = () => {
  // const [post, setPost] = useEffect({});
  let { id } = useParams();
  useEffect(() => {
    getPost(id).then(res => console.log(res));
  }, []);
  return <div>Post path</div>;
};

export default Post;
